    def searchRange(self, nums, target):
        """
        :type nums: List[int]
        :type target: int
        :rtype: List[int]
        """

        def binary_search(nums, target, find_first):
            left, right = 0, len(nums) - 1
            index = -1
            while left <= right:
                mid = (left + right) // 2
                if nums[mid] > target or (find_first and nums[mid] == target):
                    right = mid - 1
                    index = mid
                else:
                    left = mid + 1
            return index

        def search_range(nums, target):
            first_index = binary_search(nums, target, True)
            if first_index == -1:
                return [-1, -1]
            return [first_index, binary_search(nums, target, False)]

        return search_range(nums, target)

