            q.append((board, 0))
            visited = set()
            visited.add(tuple(board[0]))
            visited.add(tuple(board[1]))
            while q:
                board, moves = q.popleft()
                if is_solved(board):
                    return moves
                i, j = find_zero(board)
                for x, y in [(i-1, j), (i, j-1), (i, j+1), (i+1, j)]:
                    if 0 <= x < 2 and 0 <= y < 3:
                        new_board = [row[:] for row in board]
                        swap(new_board, i, j)
                        swap(new_board, x, y)
                        if tuple(new_board[0]) not in visited and tuple(new_board[1]) not in visited:
